import { createStore } from 'vue'
import axios from "axios";

const store = createStore({

    state:{
      status: '',
      token: localStorage.getItem('token') || '',
      user : {},
      error : '',
    },
    getters:{},
    actions:{},
    mutations:{}
});

export default store;
